import React from 'react';
import './Timetable.css';

const Timetable = () => {
  
   const data = [
  { id: 1, name: "John Doe", age: 28, city: "New York", occupation: "Engineer" },
  { id: 2, name: "Jane Smith", age: 34, city: "Los Angeles", occupation: "Designer" },
  { id: 3, name: "Bob Johnson", age: 45, city: "Chicago", occupation: "Manager" },
  { id: 4, name: "Alice Brown", age: 19, city: "Miami", occupation: "Student" },
  { id: 5, name: "Tom Wilson", age: 52, city: "Seattle", occupation: "Consultant" },
];
  return (
     <div className="table-container">
      <h2 className="table-title">User Data</h2>
      <div className="scroll-wrapper">
        <table className="data-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Age</th>
              <th>City</th>
              <th>Occupation</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.age}</td>
                <td>{item.city}</td>
                <td>{item.occupation}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};
export default Timetable;
